    return (
        <ChatEngine
        
        height="100vh"
        projectID="67ec309f-4db7-4a2d-8c5f-5310843be5c7"
        userName="Vemuna"
        userSecret="MeekendMusic2"

        //Creating Custom Component To Render For The Entire Chat Feed
        renderChatFeed={(chatAppProps) => <ChatFeed {...chatAppProps} />}
        />
    )
}

export default App;
